fun fetchSubParts(modelName: String): List<AnatomyModel> {
    val subPartNames = subPartsMap[modelName] ?: return emptyList() // Fetch subparts or return empty

    return subPartNames.map { subName ->
        AnatomyModel(name = subName, filePath = "models/$modelName/$subName.glb")
